• Гипсокартон Knauf  и каркас для гипсокартонных перегородок;     
• Металлические и акустические подвесные потолки различного типа Байкал, Акусто ПОП-15, Филигран, Албес (реечные и подвесные), ГРИЛЬЯТО;    
• Алюминиевая и оцинкованная потолочная и стеновая облицовочная рейка;     
• Изоляционные материалы Isover, Rockwool, Knauf;   
• Сухие смеси Vetonit, Knauf, Плитонит, Крепс, Shetrock;     
• Паркет ламинированный Komfort click (rus), Kronofix+ (rus), Castello click (rus), Floordreams и подложка для него;     
• Панели стеновые МФД «Союз»;     
• Керамаграни и облицовочная плитка;    
• Панели пластиковые Вегапласт, Балтэко, Пласт;   
• Блоки дверные оргалитовые по ГОСТу;    
• Двери ламинированные и дверной блок Алавус;    
• Деревянные оконные блоки по ГОСТу;    
• Деревянный стеклопакет по скандинавской технологии;    
• А также: метизы, светильники растровые, столешницы, подоконники, наличники для дверей, стеклообои, макрофлекс, различная фурнитура и прочее                      

Ремонт и отделка помещений:   
Гипсокартонные работы любой сложности(двух, трех четырехуровневые потолки и более);   
Малярные работы, покраска, обои, галтели, стены, потолок;    
Сантехника, смесители, прокладка труб, установка счетчиков;    
Электрика, установка автоматов, розетки, прокладка проводки;    
Установка дверей, окон;
